const categories = [
  {
    id: 1,
    name: '$20 - $49',
    priceRange: 'LED Bulbs, Power Banks',
    image: 'data:image/png;base64,',
  },
  {
    id: 2,
    name: '$50 - $99',
    priceRange: 'Controllers, Headsets',
    image: 'data:image/png;base64,',
  },
  {
    id: 3,
    name: '$100 - $999',
    priceRange: 'PS5, XBOX, Systems',
    image: 'data:image/png;base64,',
  },
  {
    id: 4,
    name: '$1000 - $2000',
    priceRange: 'LCD, Monitors, Gaming PC',
    image: 'data:image/png;base64,',
  },
];


const TopCategories = () => {
  return (
    <section className="py-16 bg-black text-white">
      <div className="container mx-auto px-4">
        <h2 className="text-3xl font-bold text-center mb-12 text-red-500">Shop by Price</h2>
        <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-4 gap-8">
          {categories.map((category) => (
            <div
              key={category.id}
              className="relative group rounded-xl overflow-hidden shadow-md hover:shadow-[0_0_25px_#f87171] transition duration-300"
            >
              {/* Image */}
              <img
                src={category.image}
                alt={category.name}
                className="w-full h-64 object-cover transition-transform duration-500 group-hover:scale-110"
              />

              {/* Diagonal Overlay using Tailwind mask */}
              <div className="absolute inset-0 bg-black/50 group-hover:bg-red-500/40 transition duration-300 [clip-path:polygon(0%_0%,100%_10%,100%_100%,0%_90%)]" />

              {/* Text Content */}
              <div className="absolute bottom-0 left-0 right-0 p-4 z-10">
                <h3 className="text-xl font-bold text-red-400 group-hover:text-red-300 transition duration-300">
                  {category.name}
                </h3>
                <p className="text-sm text-gray-300 group-hover:text-white transition duration-300">
                  {category.priceRange}
                </p>
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default TopCategories;
